import React from 'react';

const DetailDogs = ({match}) => {
    const {id,name,description,age,published_at,breed} = match.params;
    return(
        <div>
           Dog ID: {id}
           Dog Name: {name}
           Dog Age: {age}
           Dog Breed: {breed}
           Published: {published_at}
           Description {description}
            
        </div>
    )
}





export default DetailDogs;
